import React from "react";
import { Blog, Features, Footer, Gpt3, Header, Possibilty } from "./containers";
import { Cta, Brand, Navbar } from "./componets";
import "./App.css";
import { Route, Router, Routes } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <div className="gradiant_bg">
        <Navbar />
        <Header />
      </div>
     <Brand />
    <Gpt3 />
    <Features />
    <Possibilty />
    <Cta />
    <Blog />
    <Footer />
    </div>
  );
};

export default App;
